column8:
加湿機能と空気清浄機能の2つの機能を兼ね備えた加湿空気清浄機です。<br>パーソナルタイプの加湿空気清浄機なので寝室や子供部屋などに最適です。<br>加湿機能は標準・うるおいの2つのモード、空気清浄機能は静音・標準・強の3つのモード搭載です。<br>HEPAフィルター採用で花粉やアレル物質・たばこの煙・かびの胞子などを捕集します。<br>お手入れは加湿ヒーターお手入れランプの点灯で時期をお知らせし、専用液(クエン酸)を注ぎ洗浄ボタンで押すだけで簡単にお掃除できます。<br><br>【関連商品】<br>加湿空気清浄機集塵フィルター HXF-A25HF<br>加湿空気清浄機活性炭フィルター HXF-A25TF<br><br>●商品サイズ（cm）<br>幅約29.7×奥行約24.7×高さ約51<br>●本体重量<br>約5kg<br>●空気清浄機の適用床面積※1<br>16m2(10畳）<br>●加湿器の適用床面積（目安）<br>木造和室：8m2（5畳）<br>プレハブ洋室：13m2（8畳）<br>●加湿量（最大）<br>約300ml/h<br>●連続加湿時間※2<br>約7時間<br>●加湿切タイマー<br>2・4時間<br>●水タンク容量<br>約2.0L<br>●風量切替モード<br>静音・標準・強<br>●電源コードの長さ<br>1.8m<br>●電源<br>AC100V<br>●定格<br>周波数<br>50Hz/60Hz<br>●消費電力<br>空気清浄（静音）<br> 50Hz：5W<br> 60Hz：6W<br>空気清浄（標準）<br> 50Hz：13W<br> 60Hz：16W<br>空気清浄（標準）<br> 50Hz：23W<br> 60Hz：28W<br>空気清浄（強）＋加湿 <br> 50Hz/60Hz：288W  <br>●風量<br>空気清浄（静音）<br> 50Hz/60Hz：0.5m2/分<br>空気清浄（標準）<br> 50Hz/60Hz：1.2m2/分 <br>空気清浄（標準）<br> 50Hz：2.3m2/分<br> 60Hz：2.1m2/分<br>●運転音<br>空気清浄（静音）<br> 50Hz：23dB<br> 60Hz：21dB<br>空気清浄（標準）<br> 50Hz/60Hz：33dB<br>空気清浄（標準）<br> 50Hz：42dB<br> 60Hz：41dB<br>空気清浄（強)＋加湿<br> 50Hz：42dB<br> 60Hz：41dB<br>※1「強」運転時<br>※2　最大加湿量で連続加湿した場合<br><style type="text/css">

